import {BrowserRouter} from "react-router-dom"
import './App.css';

function App() {
  return (
    <div className="App">
        <BrowserRouter>
          <Routes>
            <Route path="/" element = {<Home/>}/>
          </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
